window.DocsSearchTypeIndex["489239571"] = [{"comments":"Builder for a flag parser without a default value.\n\nSame as 'flag', but with no default value. In particular, this flag will\nnever parse successfully by itself.\n\nIt still makes sense to use it as part of a composite parser. For example\n\n> length <$> many (flag' () (short 't'))\n\nis a parser that counts the number of \"-t\" arguments on the command line,\nalternatively\n\n> flag' true (long \"on\") <|> flag' false (long \"off\")\n\nwill require the user to enter '--on' or '--off' on the command line.\n","hashAnchor":"v","info":{"tag":"value","value":{"tag":"ForAll","annotation":null,"contents":{"visibility":"TypeVarInvisible","identifier":"a","kind":null,"type":{"tag":"TypeApp","annotation":null,"contents":[{"tag":"TypeApp","annotation":null,"contents":[{"tag":"TypeConstructor","annotation":null,"contents":[["Prim"],"Function"]},{"tag":"TypeVar","annotation":null,"contents":"a"}]},{"tag":"TypeApp","annotation":null,"contents":[{"tag":"TypeApp","annotation":null,"contents":[{"tag":"TypeConstructor","annotation":null,"contents":[["Prim"],"Function"]},{"tag":"TypeApp","annotation":null,"contents":[{"tag":"TypeApp","annotation":null,"contents":[{"tag":"TypeConstructor","annotation":null,"contents":[["Options","Applicative","Builder","Internal"],"Mod"]},{"tag":"TypeConstructor","annotation":null,"contents":[["Options","Applicative","Builder","Internal"],"FlagFields"]}]},{"tag":"TypeVar","annotation":null,"contents":"a"}]}]},{"tag":"TypeApp","annotation":null,"contents":[{"tag":"TypeConstructor","annotation":null,"contents":[["Options","Applicative","Types"],"Parser"]},{"tag":"TypeVar","annotation":null,"contents":"a"}]}]}]},"skolem":null}}},"moduleName":"Options.Applicative.Builder","name":"flag'","packageInfo":{"tag":"package","value":"optparse"},"score":1,"sourceSpan":{"end":{"column":18,"line":322},"name":".spago/p/optparse-5.0.1/src/Options/Applicative/Builder.purs","start":{"column":1,"line":319}}}]